import React from 'react'
import {useSelector} from 'react-redux'
const BreadCrumb = () => {
    const catbar = useSelector(state => state.categoryBar.value)
    // console.log(catbar);
        return (
        <div className="m-2 d-flex justify-content-start align-items-center ">
   
            {catbar.isBtn1Clicked && <h6><span style={{color:"blue",textDecoration:"underline"}}>Collection</span> </h6> }
            {catbar.isBtn2Clicked && <h6>Collection &gt; <span style={{color:"blue",textDecoration:"underline"}}>Customer-Info</span> </h6> }
            {catbar.isBtn3Clicked && <h6>Collection &gt; Customer-Info &gt; <span style={{color:"blue",textDecoration:"underline"}}>Reports</span></h6> }
            {catbar.isBtn4Clicked && <h6>Collection &gt; Customer-Info &gt; Reports &gt; <span style={{color:"blue",textDecoration:"underline"}}>Settings</span></h6> }
            {catbar.isNotesClicked && <h6>Collection &gt; <span style={{color:"blue",textDecoration:"underline"}}>Notes</span></h6> }
            <hr />
        </div>
    )
}

export default BreadCrumb
